// Dashboard.js
import React, { useState, useEffect } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import Menu from './Menu';
import axios from '../config/axiosConfig';


const Form = ({ heading }) => {
    // const [movies, setMovies] = useState([]);
    // const navigate = useNavigate();


    // useEffect(() => {
    //     const fetchMovies = async () => {
    //     try {
    //         const response = await axios.post('listmovies');
    //         if (response.status === 200) {
    //             setMovies(response.data.results);
    //         }
    //     } catch (error) {
    //       alert('Error fetching movies:', error);
    //     }
    //   };

    //   fetchMovies();
    // }, []);

    // const handleAdd = () =>{
    //     navigate('/createmovie');
    // }

  return (
    <>
    <div className="card-header">
    <strong className="card-title">{ heading }</strong>
    </div>

    <div className="card-body">
        <div className="row">
            <div className="col-md-6">
                <div className="form-group mb-3">
                    <label htmlFor="title">Movie Title</label>
                    <input 
                        type="text" 
                        id="title" 
                        className="form-control" 
                    />
                </div>
                <div className="form-group mb-3">
                    <label htmlFor="release_date">Release Date</label>
                    <input 
                        type="date" 
                        id="release_date" 
                        className="form-control" 
                    />
                </div>

            </div>
            <div className='col-md-6'>
                <div class="form-group mb-3">
                    <label for="example-textarea">Description</label>
                    <textarea class="form-control" id="example-textarea" rows="4"></textarea>
                </div>
                <div className="form-group mb-3">
                    <label htmlFor="genre">Genre</label>
                    <select className="form-control" id="genre">
                        <option value="Action">Action</option>
                        <option value="Comedy">Comedy</option>
                        <option value="Drama">Drama</option>
                        <option value="Romantic">Romantic</option>
                    </select>
                </div>
                <div className="form-group mb-3" >
                    <button type="submit" className="btn btn-primary">
                        Sign in
                    </button>
                </div>
            </div>

        </div>
    </div>
    </>
  );
};

export default Form;
